const sortMyString = (str) => {
    let arr = str.split('');
    for(let i=0; i<arr.length-1; i++){
        if((arr[i] === 'a' || arr[i] === 'A') && (arr[i+1]!== 'a' && arr[i+1]!== 'A')){
            [arr[i], arr[i+1]] = [arr[i+1], arr[i]];
            i=-1;
        }
    }
    return arr.join('');
}

